const fs = require('fs');
const svgson = require('svgson')
const { pathDataToPolys } = require('svg-path-to-polygons');


fs.readFile('convert.txt', 'utf8', function(err, data) {
  if (err) throw err;
  const SVG = data;

  svgson(SVG, {}, result => loop(result))

  function loop(result) {
    for(i = 0; i<result.length; i++){
      // console.log(result[i]);
      let styling = result[i].attrs.style;
      let points = pathDataToPolys(result[i].attrs.d, {tolerance:2, decimals:1});
      let firstThreePoints = (points[0].slice(0,3));

      console.log('<polygon class="bg" style="' + styling + '" points="' + firstThreePoints + '"></polygon>')
    }
  }

});

